How can I get the total sum ($sum) of an array from a nested field?<p>I need the total sum of all the elements in an array that is nestet in my schema.
This is the schema:</p>
<pre class="lang-js prettyprint-override"><code>const mongoose = require('mongoose');

let historySchema = new mongoose.Schema({
    time: {
        type:String
    }
})

//users schema

let userSchema = new mongoose.Schema({
    name:{
        type:String,

    },
    dob:{
        type:String,

    },
    email:{
        type:String,

    },
    noOfpeopleClimbing:{
        type: Number,
        default:0
    },
    details:{
        type:String,

    },
    status:{
        type: Boolean,
        default: false
    },
    timeIn:{
        type: Number,
        default: 0
    },
    timeOut:{
        type: Number,
        default: 0
    },
    timeFinal:{
        type: Number,
        default: 0
    },
    history:[{

        time:{
            type: Number
        },
        date:{
            type:Date,
            default:Date.now()
        },
        climbers:{
            type: Number
        },
        names:{
            type: String
        }
    }]
})
let User = module.exports = mongoose.model(&quot;User&quot;, userSchema);
</code></pre>
<p>The nested field in disscusion is:</p>
<pre><code>history:[{
    time:{
        type: Number
}]
</code></pre>
<p>And the find method is:</p>
<pre class="lang-js prettyprint-override"><code>app.get('/user/:id', function(req,res){

    Users.findById(req.params.id, function(err, users){

        res.render(&quot;user&quot;,
        {
        title:users.name,
        users:users,
        });
    })
})
</code></pre>
<p>Can I attach to my find route an aggregate with <code>$sum</code> in order for me to send the data with the sum to my render view?.</p>
<p>For example <code>totalTimeHistory:$sum aggregate data</code>.</p>

