Passing values from one function to another function<p>So I am doing a role-based access application, and I embedded the roles of users inside the JWT. When I decode the token, I get the <code>id, role...</code>. Now I have a function that checks for the token from the <code>x-auth-token</code> header. This is what the function looks like.</p>
<pre><code>export const decodeToken = (controller) =&gt; {                          
  return wrapAsync(async (httpRequest) =&gt; {                           
    const token = httpRequest.headers['x-auth-token']                 
    if (!token) {                                                     
      throw new UnauthorizedError('No token, authorization denied.')  
    }                                                                 
    const decoded = jwt.verify(token, process.env.JWT_SECRET)                                                                          
    httpRequest.user = decoded                                        
    return controller(httpRequest)                                    
  })                                                                  
}
</code></pre>
<p>I also have a function that checks for the role too which is similar to the <code>decodeToken</code> function, this is what the <code>roleCheck</code> function looks like.</p>
<pre><code>export function roleCheck(controller) {
  return wrapAsync(async (httpRequest) =&gt; {
    const token = httpRequest.headers['x-auth-token']
    const decoded = jwt.verify(token, process.env.JWT_SECRET)
    if (decoded.role !== 'admin') {
      throw new UnauthorizedError(
        'You do not have the authorization to perform this action'
      )
    }
    return controller(httpRequest)
  })
}
</code></pre>
<p>Now, there is quite some code duplication here. One way I could have solved this was to also check for the role in the <code>decodeToken</code> function, but that method will cause all routes inaccessible for users who don't have the <code>admin</code> role attached to the incoming payload. Now my question is how do I pass this</p>
<pre><code>const token = httpRequest.headers['x-auth-token']
const decoded = jwt.verify(token, process.env.JWT_SECRET)
</code></pre>
<p>from the <code>decodeToken</code> function to the <code>roleCheck</code> function. Also, is this a use case for function composition? I feel the code can be much cleaner than this, but I just don't know how to achieve that.</p>
<p>Typically, a route looks like this</p>
<pre><code>export function config(router) {
  router
    .post('/', expressCallback(decodeToken(roleCheck(postProduct))))
    .get('/', expressCallback(decodeToken(getProducts)))
    ...
  return router
}
</code></pre>
<p>So the <code>decodeToken</code> is called first, then the <code>roleCheck</code> before the request hits the <code>postProduct</code> controller. In this manner, the token is gotten from the header and decoded then the controller can act based on the role.</p>
<p>Any help will be appreciated, thanks.</p>

