Using a custom ID in a Spring Data REST repository backed by MongoDB<p>I'm working on a new project using Spring and MongoDB. I'm a novice with both of these so bear with me, I couldn't find a definitive answer to this question.</p>
<p>I'm using <code>spring-boot-starter-data-rest</code> and have a repository like this:</p>
<pre class="lang-kotlin prettyprint-override"><code>@RepositoryRestResource(collectionResourceRel = &quot;widget&quot;, path = &quot;widget&quot;)
interface WidgetRepository : MongoRepository&lt;Widget, ObjectId&gt; {
    fun findByType(@Param(&quot;type&quot;) type: String): List&lt;Widget&gt;
}
</code></pre>
<p>For an entity like this:</p>
<pre class="lang-kotlin prettyprint-override"><code>data class Widget @JsonCreator constructor(@JsonProperty val type: String) {
    @Id
    lateinit var id: ObjectId
}
</code></pre>
<p>This automatically gives you a CRUD API using the Mongo document ID:</p>
<pre><code>GET /widget/{mongo doc id}
GET /widget/search/findByType?type=
POST /widget
PUT /widget
PATCH /widget
</code></pre>
<p>But I don't want to use the Mongo document ID. I want to introduce a secondary identifier and use that everywhere in the API. This is because the &quot;widgets&quot; are items in the physical world that are barcoded, and we don't want to print the Mongo document ID in the barcode.</p>
<p>Obviously we can implement this using Spring REST API tools, eg</p>
<pre class="lang-kotlin prettyprint-override"><code>    @GetMapping(&quot;/widget/{barcode}/&quot;)
    fun getByBarcode(@PathVariable barcode: String): Widget {
        return widgetRepository.findByBarcode(barcode)
    }

</code></pre>
<p>etc.. but is there any clever way to get <code>@RepositoryRestResource</code> to build its automagic API for us with a custom ID? Maybe by implementing <code>CrudRepository&lt;Widget, Barcode&gt;</code> in such a way that we have to wrap a <code>MongoRepository&lt;Widget, ObjectId&gt;</code> ? I'm not familiar enough with how Spring works under the hood to know if anything like this is even possible.</p>
<p>Thanks in advance</p>

